import React from 'react';
import { useLocation } from 'react-router-dom';

function GetStudent() {
  const location = useLocation();
  const { idalumno } = location.state || {}; // Obtén el idalumno del estado de navegación

  console.log("Esto es el contenido: " + idalumno);

  return (
    <div>
      <p>ID del Alumno: {idalumno}</p>
    </div>
  );
}

export default GetStudent;
